import './App.css';
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';
import { useState, useEffect } from 'react';
import Spline from '@splinetool/react-spline';

// 페이지 컴포넌트들 import
import Jmcoffee from './pages/Jmcoffee';
import Highziumstudio from './pages/Highziumstudio';
import Purito from './pages/Purito';
import Sum37 from './pages/Sum37';
import Mennoblesse from './pages/Mennoblesse';
import Klaytn from './pages/Klaytn';
import Kitchen from './pages/Kitchen';

function Navigation() {
	const [hoveredPage, setHoveredPage] = useState(null);
	const [splineError, setSplineError] = useState(false);
	const [splineLoading, setSplineLoading] = useState(true);
	const [retryCount, setRetryCount] = useState(0);
	const location = useLocation();

	const pages = [
		{ 
			id: 'jmcoffee', 
			title: 'jmcoffee', 
			path: '/jmcoffee', 
			component: Jmcoffee,
			bgImage: '/images/jmcoffee_visual.jpg'
		},
		{ 
			id: 'highziumstudio', 
			title: 'highziumstudio', 
			path: '/highziumstudio', 
			component: Highziumstudio,
			bgImage: '/images/highzium_visual_2.jpg'
		},
		{ 
			id: 'purito', 
			title: 'purito', 
			path: '/purito', 
			component: Purito,
			bgImage: '/images/purito_visual.jpg'
		},
		{ 
			id: 'sum37', 
			title: 'sum37', 
			path: '/sum37', 
			component: Sum37,
			bgImage: '/images/sum_visual.jpg'
		},
		{ 
			id: 'mennoblesse', 
			title: 'mennoblesse', 
			path: '/mennoblesse', 
			component: Mennoblesse,
			bgImage: '/images/mennoblesse_visual.jpg'
		},
		{ 
			id: 'klaytn', 
			title: 'klaytn', 
			path: '/klaytn', 
			component: Klaytn,
			bgImage: '/images/klaytn_visual.jpg'
		},
		{ 
			id: 'kitchen', 
			title: 'kitchen', 
			path: '/kitchen', 
			component: Kitchen,
			bgImage: '/images/kitchen_visual.jpg'
		}
	];

	// Spline 씬 URL들 (여러 옵션 제공)
	const splineUrls = [
		"https://my.spline.design/liquidring-qkhFg3EhYg059UDpjf5TFAlA/",
		"https://prod.spline.design/6Wq1Q7YGyM-iab9i/scene.splinecode",
		"https://prod.spline.design/your-scene-url/scene.splinecode"
	];

	const currentSplineUrl = splineUrls[Math.min(retryCount, splineUrls.length - 1)];

	const handleSplineError = (error) => {
		console.error('Spline error:', error);
		setSplineError(true);
		setSplineLoading(false);
	};

	const handleSplineLoad = () => {
		setSplineLoading(false);
		setSplineError(false);
	};

	const handleRetry = () => {
		setSplineError(false);
		setSplineLoading(true);
		setRetryCount(prev => prev + 1);
	};

	// 컴포넌트 마운트 시 로딩 상태 초기화
	useEffect(() => {
		setSplineLoading(true);
		setSplineError(false);
	}, [retryCount]);

	return (
		<div className="App">
			<header className="header">
				<h1><Link to="/">Hyeri Portfolio</Link></h1>
			</header>

			<nav className="navigation">
				<ul>
					{pages.map(page => (
						<li 
							key={page.id}
							className={location.pathname === page.path ? 'active' : ''}
							onMouseEnter={() => setHoveredPage(page)}
							onMouseLeave={() => setHoveredPage(null)}
						>
							<Link to={page.path}>{page.title}</Link>
						</li>
					))}
				</ul>
			</nav>

			<div className="content-area">
				{hoveredPage ? (
					<div 
						className="hover-page"
						style={{ backgroundImage: `url(${hoveredPage.bgImage})` }}
					>
						<h2>{hoveredPage.title}</h2>
						<p>{hoveredPage.title} 프로젝트 내용입니다.</p>
					</div>
				) : (
					<div className="spline-container">
						{splineLoading && !splineError && (
							<div className="loading-content">
								<div className="loading-spinner"></div>
								<p>Loading 3D Scene...</p>
								<p className="loading-detail">Attempt {retryCount + 1} of {splineUrls.length}</p>
							</div>
						)}
						{!splineError ? (
							<Spline 
								scene={currentSplineUrl}
								style={{ width: '100%', height: '100%' }}
								onError={handleSplineError}
								onLoad={handleSplineLoad}
							/>
						) : (
							<div className="fallback-content">
								<h2>Welcome to Hyeri Portfolio</h2>
								<p>Explore my creative projects</p>
								<p className="error-detail">3D scene failed to load</p>
								<button 
									onClick={handleRetry}
									className="retry-button"
									disabled={retryCount >= splineUrls.length - 1}
								>
									{retryCount >= splineUrls.length - 1 ? 'All attempts failed' : 'Retry 3D Scene'}
								</button>
							</div>
						)}
					</div>
				)}
			</div>
		</div>
	);
}

function App() {
	return (
		<Router>
			<Routes>
				<Route path="/" element={<Navigation />} />
				<Route path="/jmcoffee" element={<Jmcoffee />} />
				<Route path="/highziumstudio" element={<Highziumstudio />} />
				<Route path="/purito" element={<Purito />} />
				<Route path="/sum37" element={<Sum37 />} />
				<Route path="/mennoblesse" element={<Mennoblesse />} />
				<Route path="/klaytn" element={<Klaytn />} />
				<Route path="/kitchen" element={<Kitchen />} />
			</Routes>
		</Router>
	);
}

export default App;
